             "getalignedaircraftlocationasync",
             "<summary> gets the aircraft location in a local coordinate (n-e-g). the origin point is the takeoff location.  the aircraft's location from the flight assistant is aligned with the gimbal attitude from `getalignedgimbalattitudeasync`,  which means that the flight controller will try to synchronize them based on the internal clock and pushes them to sdk at the  same time. this is only valid when `getalignedpushdatastartedasync` is true. start the push data by calling `startalignedpushdataasync`.  caution: starting the push data may consume the bandwidth. use it only when necessary. </summary> <returns>a `task&lt;resultvalue&lt;doublepoint3d?&gt;&gt;` object.</returns>",
             "alignedaircraftlocationchanged",
             "<summary> subscribe the event to receive changes of the aircraft location in a local coordinate (n-e-g). the origin point is the takeoff location.  the aircraft's location from the flight assistant is aligned with the gimbal attitude from `getalignedgimbalattitudeasync`,  which means that the flight controller will try to synchronize them based on the internal clock and pushes them to sdk at the  same time. this is only valid when `getalignedpushdatastartedasync` is true. start the push data by calling `startalignedpushdataasync`.  caution: starting the push data may consume the bandwidth. use it only when necessary. </summary>",
             "getalignedgimbalattitudeasync",
             "<summary> gets the gimbal attitude aligned by the flight assistant.  different from the attitude updated by the gimbal, the gimbal attitude from the flight assistant is aligned with  the location from `getalignedaircraftlocationasync`, which means that the flight controller will try to synchronize  them based on the internal clock and pushes them to sdk at the same time. this is only valid when `getalignedpushdatastartedasync`  is true. start the push data by calling `startalignedpushdataasync`.  caution: starting the push data may consume the bandwidth. use it only when necessary. </summary> <returns>a `task&lt;resultvalue&lt;attitude?&gt;&gt;` object.</returns>",
